import { config } from "./config"
import { editor } from "./editor"
import { files } from "./files"
import "./index.css"

const setWindowSize = () => {
  editor.width = window.innerWidth
  editor.height = window.innerHeight
  editor.reload()
}

const setUp = () => {
  if(window.data) {
    return
  }

  window.data = { config, files, editor }

  window.onresize = () => {
    setWindowSize()
  }

  setWindowSize()
}

setUp()
